import React from 'react';
import diceIcon from '/public/icon-dice.svg'; // Import your SVG file

const AdviceCard = ({ advice }) => {
  return (
    <div className='advice-card'>
      <h2>ADVICE #117</h2>
      {advice && <p>{advice}</p>}
      {/* Dice Icon */}
      <img src={diceIcon} alt='Dice Icon' width='24' height='24' />
    </div>
  );
};

export default AdviceCard;
